import { useState, useEffect } from 'react';
import { ethers } from 'ethers';
import axios from 'axios';

function CreateSaleForm({ contract, userAddress }) {
  const [eventName, setEventName] = useState('');
  const [eventOrganizer, setEventOrganizer] = useState('');
  const [eventDate, setEventDate] = useState('');
  const [ticketPrice, setTicketPrice] = useState('');
  const [saleEndDate, setSaleEndDate] = useState('');
  const [posterFile, setPosterFile] = useState(null);
  const [ticketImageFile, setTicketImageFile] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleFileChange = (setter) => (e) => {
    const file = e.target.files[0];
    if (file) setter(file);
  };

  const uploadToPinata = async (file) => {
    const formData = new FormData();
    formData.append('file', file);

    try {
      const res = await axios.post('http://localhost:4000/upload', formData, {
        headers: { 'Content-Type': 'multipart/form-data' },
      });
      return res.data.cid;
    } catch (error) {
      console.error('Gagal mengunggah ke Pinata:', error);
      throw new Error('Upload ke Pinata gagal');
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!contract || !userAddress) {
      alert('Pastikan kontrak dan dompet Anda terhubung.');
      return;
    }

    setLoading(true);
    try {
      const posterUrl = await uploadToPinata(posterFile);
      const ticketImageUrl = await uploadToPinata(ticketImageFile);

      const priceInWei = ethers.utils.parseEther(ticketPrice);
      const saleEnd = Math.floor(new Date(saleEndDate).getTime() / 1000);
      const eventDateTimestamp = Math.floor(new Date(eventDate).getTime() / 1000);
      const barcode = Math.floor(Math.random() * 1e12);

      const tx = await contract.createTicket(
        eventName,
        eventOrganizer,
        posterUrl,
        ticketImageUrl,
        priceInWei,
        saleEnd,
        eventDateTimestamp,
        barcode,
        { value: ethers.utils.parseEther('0.05') }
      );

      await tx.wait();
      alert('Tiket berhasil dibuat!');
    } catch (error) {
      console.error('Gagal membuat tiket:', error);
      alert('Gagal membuat tiket: ' + error.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Buat Penjualan Tiket</h2>
      <label>
        Nama Acara:
        <input type="text" value={eventName} onChange={(e) => setEventName(e.target.value)} required />
      </label>

      <label>
        Penyelenggara:
        <input type="text" value={eventOrganizer} onChange={(e) => setEventOrganizer(e.target.value)} required />
      </label>

      <label>
        Tanggal Acara:
        <input type="date" value={eventDate} onChange={(e) => setEventDate(e.target.value)} required />
      </label>

      <label>
        Tanggal Akhir Penjualan:
        <input type="date" value={saleEndDate} onChange={(e) => setSaleEndDate(e.target.value)} required />
      </label>

      <label>
        Harga Tiket (ETH):
        <input type="number" value={ticketPrice} onChange={(e) => setTicketPrice(e.target.value)} required />
      </label>

      <label>
        Poster Acara:
        <input type="file" onChange={handleFileChange(setPosterFile)} required />
      </label>

      <label>
        Gambar Tiket:
        <input type="file" onChange={handleFileChange(setTicketImageFile)} required />
      </label>

      <button type="submit" disabled={loading}>
        {loading ? 'Memproses...' : 'Buat Tiket'}
      </button>
    </form>
  );
}

export default CreateSaleForm;
